🫶How to MomSlay the First Day of School🫶
(Save this if your kids haven’t started yet)

1. Prepare yourself because it’s gonna be tough.

2. Give yourself as much grace as possible.

3. Don’t neglect yourself no matter how hectic it gets even if that means taking 10 minutes out of the day to do your make up, please do it. 

4. Remember that every other parent is in the same boat as you.

5. Most important your kids need a happy mom and not a perfect mom ♥️

